window.bookSummaryJSON = "<p>A deadly infection spreads across Europe. The Undead series: a terrifying account of one man desperately struggling to survive this harrowing event day by day. Part one - days one to three. </p> <p>Howie is at home on a rare Friday night off work when an infection which has rapidly spread across Europe hits his hometown on the South Coast of England. Luck sees him through the first night when many others are taken down and infected, only to rise again as the undead. In surviving, Howie quickly learns and evolves, developing a new set of skills that will save him from disaster. </p> <p>With a former work colleague, Dave, at his side, he braves the urban squalor of a ruined Portsmouth and begins to understand his desire to remain good in a world rapidly descending into chaos, where only the strongest survive.</p>"; 
